import React from 'react'
import styled from "styled-components";

const StyledInput = styled.input`
  width: 100%;
  height: 25px;
  margin-right: 10px;
  border-radius: 5px;
  padding: 6px;
  font-size: 15px;
  outline: none;
  border: 1px solid white;
  background: none;
  color: white;
  &::placeholder {
  color: white;
  }

`;
const SearchPanel = () => {
    return (
        <StyledInput type="text" placeholder='search'/>
    )
};

export default SearchPanel;
